jQuery(document).ready(function () {
    // Initialize Pixio (assuming it's safe to do this when DOM is ready)
    Pixio.init();

    // Hide the preloader as soon as the DOM is ready
    // This is the primary change for making the preloader disappear quickly
    jQuery("#loading-area").fadeOut(300, function() {
        jQuery(this).remove(); // Remove the element from the DOM after fading out
    });

    // Existing tab click functionality
    $('a[data-bs-toggle="tab"]').click(function () {
        // This nested click handler seems redundant and might cause issues.
        // It means clicking a tab sets up *another* click handler for all tabs.
        // If the intention is to make the clicked tab active and hide others,
        // the inner click function is executed on the *first* click.
        // It's likely you only need the outer function.
        // Let's assume the inner function is what you intended to execute on click.
        $($(this).attr("href")).show().addClass("show active").siblings().hide();
    });

    // Existing navicon toggle functionality
    jQuery(".navicon").on("click", function () {
        $(this).toggleClass("open");
    });

    // Existing toggle-btn functionality for account sidebar
    jQuery(".toggle-btn").on("click", function () {
        $(this).toggleClass("active");
        $(".account-sidebar").toggleClass("show");
    });

    // Existing form toggle functionality (login/forget password)
    $(".form-toggle").click(function () {
        $(".login-area").hide();
        $(".forget-password-area").slideDown("slow");
    });
});

jQuery(window).on("load", function () {
    // Call Pixio.load() when all assets are fully loaded
    // This is retained here as Pixio.load() might depend on all resources
    Pixio.load();

    // Focus outline accessibility listeners
    document.body.addEventListener("keydown", function () {
        document.body.classList.add("show-focus-outline");
    });
    document.body.addEventListener("mousedown", function () {
        document.body.classList.remove("show-focus-outline");
    });
});

// Window resize handler for Pixio
jQuery(window).on("resize", function () {
    Pixio.resize();
});

// Window scroll handler for Pixio
jQuery(window).on("scroll", function () {
    Pixio.scroll();
});